import { Box, Stepper } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import React, { useContext } from "react";
import { AuthContext } from "../../common/AuthContext";

const OrderDtl = () => {
  const steps = ["Item", "Select Address", "Confirm Order"];
  const {address } = useContext(AuthContext);
  return (
    <Box sx={{ width: "75%", margin: "auto", marginTop: 10 }}>
      <Stepper activeStep={1} alternativeLabel>
        {steps.map((label) => (
          <Step key={label}>
            <StepLabel>{label}</StepLabel>
          </Step>
        ))}
      </Stepper>
      <Grid2 container direction="row" sx={{ ml: 10 }}>
        Select Address :  <select
          style={{
            width: "250px",
            padding: "8px",
            borderRadius: "5px",
            marginLeft: "5px",
          }}
        >
        </select>
      </Grid2>
      <Grid2
        container
        direction="row"
        alignItems="center"
      >
{address.amp((item)=>{
    <option value={item.address +'-' + item.addType}></option>
})}

      </Grid2>
    </Box>
  );
};


export default OrderDtl;
